import * as React from 'react';

const pageStyles = {
    color: '#232129',
    padding: 96,
    fontFamily: '-apple-system, Roboto, sans-serif, serif',
};

const IndexPage = () => {
    return (
        <main style={pageStyles}>
            <div>GATSBY CMS BOILERPLATE</div>
        </main>
    );
};

export default IndexPage;
